import React, { useState } from "react"

import { IUser } from "@shared/interfaces"
import { Link } from "react-router-dom"
import { PathEnum } from "@shared/enums"
import { Table } from "antd"
import { useUsers } from "../hooks/useUsers"

export const UsersList = () => {
	console.log("I am called")
	const [page, setPage] = useState<number>(1)
	const { data, isLoading } = useUsers({
		options: {
			page: page,
			take: 10,
		},
	})
	const dataSource = data?.data?.payload?.map((x: IUser) => ({
		id: x.id,
		name: x.name,
		email: x.email,
		address: x.address || "N/A",
		phoneNumber: x.phoneNumber,
		type: x.type,
	}))
	return (
		<Table
			columns={columns}
			dataSource={dataSource}
			loading={isLoading}
			pagination={{
				pageSize: 10,
				total: data?.data?.total,
				onChange: (page: number) => {
					setPage(page)
				},
			}}
		/>
	)
}

const columns = [
	{
		title: "Name",
		dataIndex: "name",
		key: "name",
	},
	{
		title: "Email",
		dataIndex: "email",
		key: "email",
	},
	{
		title: "Address",
		dataIndex: "address",
		key: "address",
	},
	{
		title: "phoneNumber",
		key: "phoneNumber",
		dataIndex: "phoneNumber",
	},
	{
		title: "Type",
		key: "type",
		dataIndex: "type",
	},
	{
		title: "Action",
		dataIndex: "id",
		key: "id",
		render: (id: any) => (
			<Link to={`${PathEnum.UserUpdate}/${id}`}>Update</Link>
		),
	},
]
